import React from 'react'
import "../styles/ListItem.css"

export default function ListItem({item}) {
    return (
        <>
            {
                item.details !== "" ? (
                    <div className={"msgContainer"}>
                        <p className={"msgInfo"}>{item.timestamp + " " + item.user + ":"}</p>
                        <p className={"msg"}>Hi</p>
                    </div>

                ) : (
                    <p>{item.user}</p>
                )
            }
        </>
    )
}
